import axios from "axios";

const login = (username, password) => {
  if (username && password) {
    axios.get(`/api/auth?${username}&${password}`)
      .then( (result) => {
        console.log(result);
      } )
  }
}

const generateSessionId = () => {
  return Math.random().toString(16).substr(2, 64);
}

export default login;
